def multiinsert(conn, cur, sql, args):
    start = time.time()
    try:
        cur.executemany(sql, args=args)
        conn.commit()
    except:
        print("Happen Some error")
        conn.rollback()
    end = time.time()
    print("Insert execute time ", end - start, "second")

