def mysql_to_mysql(tbname):
    conn = get_conn()
    cur = conn.cursor()
    s_conn = get_source_conn()
    s_cur = s_conn.cursor()
    loopnum = 0
    rangestart = querymaxid(cur,tbname) +1
    sourceminid = queryminid(s_cur,tbname)
    if rangestart < sourceminid:
        rangestart = sourceminid
    rangeend = rangestart + 200001
    y = queryfirstone(s_cur,tbname)
    formatt = ','.join(['%s'] * y)
    sql = "INSERT INTO %s VALUES (%s)" % (tbname, formatt)
    for x in range(rangestart, rangeend, 100000):
        loopnum += 1
    print("loopnum=%s" % (loopnum), "maybetime=%smins" % (loopnum * 7 / 60))
    for x in range(rangestart, rangeend, 100000):
        if x == rangestart:
            startx = x
        else:
            endx = x - 1
            #zz = ("select * from merchant_games where id between %s and %s" % (startx, endx))
            querysourcedata = ("select * from %s where id between %s and %s" % (tbname, startx, endx))
            results = query_all(cur=s_cur, sql=querysourcedata, args=None)  ### cost 11s to fetchall
            if len(results) == 0:
                print("NO results")
                break
            else:
                # sql = 'insert into merchant_games values(%s,%s,%s,%s,%s,%s,%s,%s,%s)'
                multiinsert(conn, cur, sql, results)
            if x > 0:
                startx = x
    cur.close()
    conn.close()
    s_cur.close()
    s_conn.close()
    skype_message("Import %s success %s" % (tbname, rangeend))

def queryfirstone(s_cur,tbname):
    sql = 'select * from %s limit 1' % (tbname)
    results = query_all(cur=s_cur, sql=sql, args=None)
    #print(len(results[0]))
    return len(results[0])

def queryminid(s_cur,tbname):
    sql = 'select min(id) from %s' % (tbname)
    results = query_all(cur=s_cur, sql=sql, args=None)
    return results[0][0]

def querymaxid(cur,tbname):
    sql = 'select max(id) from %s' % (tbname)
    results = query_all(cur=cur, sql=sql, args=None)
    if results[0][0] == None:
        return 0
    return results[0][0]


